insert  into `macroproceso`(`id_macroproceso`,`macroproceso`,`objetivo`,`estado`) values (1,'Estrategicos','Los procesos estratégicos se establecen por medio de la alta dirección, puesto que definen como opera la organización y cómo se genera valor. Sirven de soporte especialmente en la toma de decisiones del proceso estratégico.','ACTIVO'),(2,'Misionales','Los procesos misionales están orientados a aportar valor. Por ello están directamente relacionados con los  servicios que ofrece la Cooperativa. Por ello el resultado de estos procesos es apreciado directamente por el asociado','ACTIVO'),(3,'Apoyo','los procesos de apoyo dan soporte a los procesos Misionales y los procesos estratégicos. Son fundamentales para alcanzar los objetivos de todos los procesos y del sistema de la empresa en general.','ACTIVO');

/*Data for the table `proceso` */

insert  into `proceso`(`id_proceso`,`id_macroproceso`,`proceso`,`sigla_proceso`,`objetivo`,`estado`) values (1,3,'Gestión Administrativa','AD','Garantizar la disponibilidad de recursos necesarios para el desarrollo del Sistema de Gestión de Calidad, con personal competente, productos y servicios acordes a los requerimientos de tiempo, precio y calidad.','ACTIVO'),(2,1,'Asamblea General De Asociados','AG','Establecer las politicas para el desarrollo de las asambleas generales de asociados','ACTIVO'),(3,2,'Gestión De Ahorros','AH','Fortalecer la cultura del ahorro en cada uno de nuestros asociados y su núcleo familiar en los diferentes productos de ahorros a la vista, CDAT y PROGRAMADO, de tal forma poder obtener recursos financieros que permitan ampliar los servicios que la cooperativa presta a los asociados, con los cuales estos mejoran su bienestar social y logran los objetivos propuestos.','ACTIVO'),(4,2,'Gestión De Asociados','AS','Establecer políticas para la vinculación de los potenciales asociados, buscando cumplir la normatividad ','ACTIVO'),(5,2,'Gestión De Cartera','CA','Establecer políticas de control y recuperación de la cartera de crédito, buscando implementar procedimientos técnicos y eficientes para la administración, que permitan obtener mayor agilidad, coordinación y efectividad en el recaudo de la cartera de la Cooperativa.','ACTIVO'),(6,2,'Gestión De Créditos','CC','Asegurar la adecuada colocación de nuevos Créditos a los Asociados según la reglamentación vigente se aptos para el otorgamiento de estos, de una forma ágil y oportuna, de manera que permita cumplir con los objetivos de calidad. Trabajando por una recuperación de la Cartera coordinada y efectiva aplicando la reglamentación vigente.','ACTIVO'),(7,1,'Consejo De Administración','CD','Establecer las politicas para  establecer los acuerdos, objetivos y funciones del consejo de administracion cumpliento con la normatividad vigentes','ACTIVO'),(8,2,'Gestión De Caja','CJ','Garantizar la identificación de las operaciones realizadas en caja, tales como consignaciones, pagos y/o retiros. Salvaguardando la seguridad en el control y el manejo del efectivo','ACTIVO'),(9,3,'Gestión De Calidad','CL','Asegurar el mantenimiento y fortalecimiento del sistema de gestión de calidad de la cooperativa mediante el uso de mecanismos que contribuyan a la mejora continua de los procesos.','ACTIVO'),(10,3,'Gestión De Convenios','CN','Establecer las actividades que se deben desarrollar para suscribir convenios comerciales, de libranza, de pago de nómina y de recaudo en la Cooperativa.','ACTIVO'),(11,3,'Gestión Corresponsales Solidarios','CO','Documentar y seleccionar el modelo de corresponsales cooperativos que se implementa en la Cooperativa, cumpliendo cada uno de los requisitos exigidos por la superintendencia de economía solidaria','ACTIVO'),(12,1,'Gestión De Elección De Delegados','DL','Establecer las politicas para el desarrollo de las elecciones de los delegados a la asambleas generales de delegados','ACTIVO'),(13,3,'Gestión Financiera','FN','Planear, registrar, ejecutar y controlar los recursos y movimiento financieros de la Cooperativa de ahorro y crédito Coonfie de acuerdo con la normatividad vigente a través de herramientas e instrumentos.','ACTIVO'),(14,3,'Gestión Comercial','GC','Identificar las necesidades y los requisitos del cliente buscando la satisfacción de este; a fin de ampliar la cobertura dentro del mercado mediante mercadeo y publicidad.','ACTIVO'),(15,3,'Gestión Documental','GD','Planear, organizar y controlar el sistema de gestión documental de\nacuerdo con las normas internacionales, instructivos, procedimientos y manuales internos, para garantizar su eficaz funcionamiento, organización, conservación y valoración de los documentos de la Cooperativa.','ACTIVO'),(16,3,'Multiportal Transaccional','MT','Establecer los lineamientos y directrices para el manejo y uso del PORTAL TRANSACIONAL para personas naturales o personas jurídicas, ya sea por medio del a plataforma web o el aplicativo móvil.','ACTIVO'),(17,3,'Gestión Normas Transitorias','NT','','ACTIVO'),(18,1,'Planeación','PN','Diseñar y administrar políticas, lineamientos, directrices, planes, programas, proyectos mediante metodologías, análisis de información, estudios e investigaciones, seguimiento y asesoría técnica, con el fin de generar conocimiento para la toma de decisiones y contribuir al cumplimiento de metas, objetivos y misión de la entidad.','ACTIVO'),(19,3,'Gestión De Proveedores','PV','Establecer las actividades que conlleven a seleccionar los proveedores para el suministro de bienes y/o servicios, garantizando transparencia e igualdad de oportunidades, como también satisfacción frente a los requerimientos y necesidades específicas de la Cooperativa.','ACTIVO'),(20,2,'Gestión De Semilla Cooperativa','SC','','ACTIVO'),(21,3,'Gestión De Sistemas','SI','Generar e implementar soluciones tecnológicas que provean en forma oportuna, eficiente y transparente la información necesaria para el cumplimiento de los fines misionales de la cooperativa y formular lineamientos de estándares y buenas prácticas para el manejo de la información.','ACTIVO'),(22,1,'Sistema De Administración De Riesgo','SR','Diseñar, gestionar y direccionar los controles necesarios para operar de forma adecuada lo establecido por los entes de control, implementando políticas y procedimientos que permitan identificar, medir, controlar y monitorear los riesgos de la Cooperativa con el fin de mejorar la rentabilidad.','ACTIVO'),(23,3,'Gestión De Tarjeta Debito','TD','Establecer las actividades para la entrega de las tarjeta débito de convenio con el banco Coopcentral, por primera vez o por reposición; y los servicios que se habilitan por parte de la Cooperativa a sus tarjetas habitantes.','ACTIVO'),(24,3,'Gestión Talento Humano','TH','Establecer la metodología, lineamientos y directrices apropiados para la selección, contratación y Desvinculación del personal de la cooperativa','ACTIVO'),(25,3,'Gestión De Tesorería','TS','Establecer las actividades necesarias que garanticen de forma eficiente y eficaz la seguridad, los márgenes de liquidez y rentabilidad para los recursos financieros de la cooperativa, mediante el correcto proceso de las operaciones contables y la gestión de pagos','ACTIVO'),(26,1,'Comites','CM','Establecer los reglamentos de los comites de la cooperativa','ACTIVO');

